import React, { useState } from "react";
import { ethers } from "ethers";
import {
    MDBInput,
    MDBCol,
    MDBRow,
    MDBCheckbox,
    MDBBtn,
    MDBIcon
  } from 'mdb-react-ui-kit';

const Retrieve = () => {
return(
<form>
      <MDBInput className='mb-4' type='email' id='form2Example1' label='Stored hash' />

      <MDBBtn type='submit' className='mb-4' block>
        Sign in
      </MDBBtn>
    </form>
);
}

export default Retrieve;
